import React, { Component } from 'react';


const Header = () => {
  return(
    <div>
      <h1>Ini adalah Header</h1>
    </div>
  )
}

class App extends Component {
  render() {
    return(
      <div>
      <h1>Hallo Azima</h1>
    </div>
    );
  }
}

export default App;
